import React from 'react'
 import axios from 'axios'
export default function CreateProject() {



handleSubmit = (e)=>{
    e.preventDefault()
    axios.post('http://localhost:5000/api')
}


    return (
        <div>
            <h2>Create project</h2>
            <form onSubmit={handleSubmit}>
            <input type="text" placeholder='name'/>
            <button>Add</button>
            </form>
        </div>
    )
}
